import './Form.css';

function Form() {

  const inputEl = useRef(null);

  return (
    <div className="form">
      <form>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}

export default Form;
